import "./Navbar.css";
export const Navbar = ()=> {
    return (
        <nav className="navbar">
            <ul className="nav_lista">
            <li><a className="lista-enlace" href="">Sobre Nosotros</a></li>
            <li><a className="lista-enlace" href="">Inicio</a></li>
            <li><a className="lista-enlace" href="">Mi Favoritos</a></li>
            </ul>
        </nav>
    )
}
